import Navbar from "./Components/Navbar/Navbar";
import SignUp from "./Components/Registration/SignUp";
import Login from "./Components/Login/Login";
import LoanProductLine from "./Components/Product/LoanProductLine";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Products from "./Components/Product/Product";
import NotFound from "./Components/NotFound/NotFound";
import ProductDetail from "./Components/Product/ProductDetail";
import ViewCompanyBasicInformation from "./Components/Enterprise/Basic/ViewCompanyBasicInformation";
import ViewCompanyAddress from "./Components/Enterprise/Address/ViewCompanyAddress";
import ViewCompanyEmployees from "./Components/Enterprise/Employee/ViewCompanyEmployees";
import ViewSoleAndPartnership from "./Components/Enterprise/SoleAndPartnership/ViewSoleAndPartnership";
import ViewSeniorManagementStaff from "./Components/Enterprise/SeniorManagementStaff/ViewSeniorManagementStaff";
import ViewSOEAndGovernmental from "./Components/Enterprise/SOEAndGovernmental/ViewSOEAndGovernmental";
import ViewPLCAndShareInfo from "./Components/Enterprise/PLCAndShare/ViewPLCAndShareInfo";
const App = () => {
  return (
    <div>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<LoanProductLine />} />
          <Route path="/product/:baseLine/:groupId" element={<Products />} />
          <Route
            path="/product/:baseLine/:groupId/:productId"
            element={<ProductDetail />}
          />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/login" element={<Login />} />
          <Route path="*" element={<NotFound />} />
          <Route path="/enterprise" element={<ViewCompanyBasicInformation />} />
          <Route
            path="/enterprise/:companyId"
            element={<ViewCompanyAddress />}
          />
          <Route
            path="/enterprise/employee/:companyId"
            element={<ViewCompanyEmployees />}
          />
          <Route
            path="/enterprise/view/:companyId"
            element={<ViewCompanyEmployees />}
          />
          <Route
            path="/enterprise/sole-and-partnership/:companyId"
            element={<ViewSoleAndPartnership />}
          />
          <Route
            path="/enterprise/senior-and-management-staff/:companyId"
            element={<ViewSeniorManagementStaff />}
          />
          <Route
            path="/enterprise/soe-and-governmental/:companyId"
            element={<ViewSOEAndGovernmental />}
          />
          <Route
            path="/enterprise/plc-and-share/:companyId"
            element={<ViewPLCAndShareInfo />}
          />          
        </Routes>
      </Router>
    </div>
  );
};

export default App;
